import React from "react";
import './login.css';

export default class Login extends React.Component{

    state = {
        email: '',
        password: ''
    }

    render(){
        return(
            <div className='container'>
              <div className='row'>
                <div className='col-md-6' style={this.styles.colMd6} >
  <div style={{width: 619, height: 861, position: 'relative'}}>
    <div style={{width: 619, height: 861, left: 0, top: 0, position: 'absolute', background: '#DBDBDB', borderRadius: 30}}></div>
    <div style={{left: 165, top: 53, position: 'absolute', color: '#838383', fontSize: 100, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word'}}>LOGO</div>
    <div style={{width: 484, height: 219, left: 68, top: 319, position: 'absolute'}}>
      <div style={{left: 10, top: 0, position: 'absolute', color: '#838383', fontSize: 30, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word'}}>Login</div>
      <div style={{left: 10, top: 112, position: 'absolute', color: '#838383', fontSize: 30, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word'}}>Senha</div>
      <div style={{width: 484, height: 56, padding: 10, left: 0, top: 41, position: 'absolute', background: '#ECECEC', borderRadius: 5, borderBottom: '2px #838383 solid'}} />
      <div style={{width: 484, height: 56, padding: 10, left: 0, top: 163, position: 'absolute', background: '#ECECEC', borderRadius: 5, borderBottom: '2px #838383 solid'}} />
    </div>
    <div style={{width: 435, height: 54, left: 92, top: 691, position: 'absolute'}}>
      <div style={{width: 435, height: 54, left: 0, top: 0, position: 'absolute', background: '#838383', borderRadius: 10, border: '1px white solid'}} />
      <div style={{width: 435, left: 0, top: 12, position: 'absolute', textAlign: 'center', color: 'white', fontSize: 24, fontFamily: 'Inter', fontWeight: '700', wordWrap: 'break-word'}}>ENTRAR</div>
    </div>
    <div style={{left: 219, top: 765, position: 'absolute', color: '#838383', fontSize: 20, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word'}}>Esqueceu a senha?</div>
    <div style={{left: 163, top: 174, position: 'absolute', color: '#838383', fontSize: 32, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word'}}>Bem Vindo ao SGP</div>
  </div>
</div>
                  </div>
                </div>
          )
    }

    styles = {
        colMd6:{
            position: 'relative',
            left: '300x'
        }
    };


}
